    [],nt"num_tags": 8,nt"name": "national-bison-range-refuge-narrative-report-may-1-to-august-31-1963",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for National Bison
    Range outlines Refuge accomplishments from May through August of 1963. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    reptiles, and disease- is also covered. The Refuge development and maintenance section
    discusses physical developments, vegetation control, and wildfires. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    and safety. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
